import './App.css';
import "leaflet/dist/leaflet.css";
import { Container, Row} from 'react-bootstrap';
import Col from 'react-bootstrap/Col';
function App() {
  return (
    <div className="App">
      <header>
        <Container fluid="sm">
          <Row>
            <Col xs><h1>COVID-19 TRACKER</h1></Col>
          </Row>
        </Container>
      </header>
    </div>
  );
}
export default App;
